import knex from 'knex';
import debug from 'debug';
const deb = debug('app:app.register')

const db = knex({
    client: 'pg',
    connection: {
        host : '127.0.0.1',
        user : 'facebox',
        password : '0000',
        database : 'facebox'
    }
});

export function register(req, res) {

        db('users').insert({
            name: req.body.name,
            joined: new Date()
        })
        .then(user => {
            res.status(200).json({
                message: 'User Created',
                user: {

                    name: user.name
            }

        })

    deb(req.body)
    })
}
